import React from 'react'
import LanguageItem from "../components/languageItem"

 function languageItem() {

    const language = [
        {
            icon : "fab fa-html5",
            text : "HTML5"
        }, 
        {
            icon : "fab fa-css3",
            text : "CSS3"
        },
        {
            icon : "fab fa-js",
            text : "JavaScript"
        },
        {
            icon : "fab fa-react",
            text : "ReactJS"
        },
        {
            icon : "fab fa-php",
            text : "PHP"
        },
        {
            icon : "fab fa-sass",
            text : "SASS"
        }
    ]
    return (
        <div className="language">
                language.map(item => {
                    <LanguageItem value={item}></LanguageItem>
                })
            }
        </div>
    )
}

export default languageItem;
